import React , {useState} from 'react';
import {Link} from 'react-router-dom'

function Navbar() {
    return (
        <>
        <nav className="navbar">
            <div className="navbar-container">
                <Link to='/' className='navbar-logo'>
                    Template <i className="fa fa-user" />
                </Link>
            </div>
        </nav>
        </>
    )
}

export default Navbar
